function CustomInput({ props }) {
  const {
    labelText,
    inputID,
    inputAccuracy,
    defaultValue,
    hasInfoIcon,
    infoImage,
    allowChange,
  } = props;
  return (
    <div>
      <label for={inputID}>{labelText}</label>
      <input
        type="number"
        id={inputID}
        defaultValue={defaultValue}
        disabled={!allowChange}
      ></input>
    </div>
  );
}
